import React,{Component} from "react";
import {View,Text} from "react-native";

class Category extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <View>
               <Text>{this.props.route.params.categoryName}</Text>
            </View>
        )
    }
}

export default Category;
